import React from 'react';
import './navbar.css'

function Navbar() {
  return (
    <nav>
      <div>
        <h1>Business Solution</h1>
      </div>
      <ul>
        <li>Driver</li>
        <li>Rider</li>
        <li>Business</li>   
        <li>Log in</li>
        <li>Sign up</li>
        <li>En</li>
      </ul>
    </nav>
  );
}

export default Navbar;
